import logo from "./logo.svg";
import "./App.css";
import Datas from "./data.json";
import Infos from "./example_data.json";

function App() {
  const info = Infos.map((Info) => (
    <ul key={Info.id}>
      <li>
        <h1>Name {Info.name}</h1>
      </li>
      <li>
        <h3>Categories : {Info.categories}</h3>
      </li>
      <li>
        <h3>Image</h3>
        <img src={Info.profile_image_url} alt={"logo"} width="100" />
      </li>
      {Info.images.indexOf(0)}

      <li>
        <h4>Images</h4>

        <img src={Object.keys(Info.images)} alt={"logo1"} width="100" />
        {console.log(Object.keys(Info.images))}
        {/* {Object.values(Info.images)} */}
      </li>
    </ul>
  ));
  const test = Datas.map((data) => (
    <ul key={data.id}>
      <li> name{data.color}</li>
      <li>{data.value}</li>
      <br />
    </ul>
  ));

  return (
    <div className="App">
      <h1>APP</h1>
      {info}
    </div>
  );
}

export default App;
